    false,nt"url": null,nt"notes": "This annual narrative report for Koyukuk
    NWR outlines Refuge accomplishments during the 1982 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    management planning, public participation, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, funding, and safety is given. Habitat management is
    also covered; subjects include wetlands, forests, fire management, and wilderness
    areas. The wildlife section of the report discusses wildlife diversity, endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, and fisheries resources. The public uses of the Refuge described in
    this report include hunting, fishing, trapping, and law enforcement. The equipment
    and facilities section of the report provides information about rehabilitation,
    equipment replacement, and communication systems. Items of interest are provided
    at the end.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
